import rootstyle from '../styles/root.module.css'

const Balance = () => {
	const { user } = useAuth()

	useEffect(() => {
		if (user) {
			setUserId(user.id)
		}
	}, [user]) //

	return (
		<div className={rootstyle.wrapper}>
			<NavBar />
			<div className={rootstyle.Container}>
				<BurgerMenu />

				<main className={rootstyle.Main}> тут буде баланс </main>
			</div>
			<Footer />
		</div>
	)
}

export default Balance
